import "./style.css";
import logo from './logo.svg';
import Navbar from '../navbar/navbar.js';

const Header = () => {
    return (
        <header>
            <div className="container">
                <div className="header">
                    <logo/>
                    <ul className="logo"> 
                        <li className="logo--item"><b>Краснолесья</b><span>14<em>к</em>5</span></li>
                        <li className="logo--item">Товарищество собственников жилья</li>
                    </ul>
                    <Navbar />
                </div>
            </div>
        </header>

    );
  }
  
  export default Header;
